import React from "react";
import useGitProjectCalculator from "../../container/gitprojects/useGitProjects";
//
import GitProject from "./GitProject";
const LangGenerator: React.SFC = () => {
  const { gitLangFreq, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  return (
    <React.Fragment>
      {gitLangFreq &&
        gitLangFreq.data.map((item) => {
          return (
            <GitProject
              name={item.name}
              url={item.html_url}
              language={item.language}
            />
          );
        })}
    </React.Fragment>
  );
};

export default LangGenerator;
